import React from 'react';
import {Star, Square, Container} from './style'

export const Background = () => {
  return <Container>
      <Star
            h="3px"
            w="3px"
            animate={{ y: [-1000, 1000] }}
            transition={{ ease: "linear", duration: 15, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1400, 1400] }}
            transition={{ ease: "linear", duration: 20, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-1090, 1090] }}
            transition={{ ease: "linear", duration: 13, repeat: Infinity }}
            />
            <Square
            w="20px"
            h="90px"
            color="DeepPink"
            animate={{ y: [-1520, 1000], rotate: [0, 360] }}
            transition={{ ease: "linear", duration: 14, repeat: Infinity }}
            />
            <Star
            h="1px"
            w="1px"
            animate={{ y: [-1200, 1200] }}
            transition={{ ease: "linear", duration: 13, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1300, 1300] }}
            transition={{ ease: "linear", duration: 17, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-900, 900] }}
            transition={{ ease: "linear", duration: 19, repeat: Infinity }}
            /><Star
            h="3px"
            w="3px"
            animate={{ y: [-1000, 1000] }}
            transition={{ ease: "linear", duration: 15, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1400, 1400] }}
            transition={{ ease: "linear", duration: 20, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-1090, 1090] }}
            transition={{ ease: "linear", duration: 12, repeat: Infinity }}
            />
            
            <Star
            h="1px"
            w="1px"
            animate={{ y: [-1200, 1200] }}
            transition={{ ease: "linear", duration: 3, repeat: Infinity }}
            />
            <Star
            h="1px"
            w="1px"
            animate={{ y: [-1300, 1300] }}
            transition={{ ease: "linear", duration: 12, repeat: Infinity }}
            />
            <Star
            h="1px"
            w="1px"
            animate={{ y: [-900, 900] }}
            transition={{ ease: "linear", duration: 17, repeat: Infinity }}
            /><Star
            h="3px"
            w="3px"
            animate={{ y: [-1000, 1000] }}
            transition={{ ease: "linear", duration: 5, repeat: Infinity }}
            />
            <Star
            h="1px"
            w="1px"
            animate={{ y: [-1400, 1400] }}
            transition={{ ease: "linear", duration: 10, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-1090, 1090] }}
            transition={{ ease: "linear", duration: 5, repeat: Infinity }}
            />

            <Square
            w="50px"
            h="90px"
            r="50px"
            color="violet"
            animate={{ y: [-1520, 1000], rotate: [0, 360], x:[-500, 500] }}
            transition={{ ease: "linear", duration: 40, repeat: Infinity }}
            />

            <Star
            h="1px"
            w="1px"
            animate={{ y: [-1200, 1200] }}
            transition={{ ease: "linear", duration: 13, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1300, 1300] }}
            transition={{ ease: "linear", duration: 14, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-900, 900] }}
            transition={{ ease: "linear", duration: 13, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1000, 1000] }}
            transition={{ ease: "linear", duration: 15, repeat: Infinity }}
            />
            <Square
            w="200px"
            h="200px"
            animate={{rotate: [0, 360], x:[-1500, 1000] }}
            transition={{ ease: "linear", duration: 30, repeat: Infinity }}
            />
            <Star
            h="3px"
            w="3px"
            animate={{ y: [-1400, 1400] }}
            transition={{ ease: "linear", duration: 20, repeat: Infinity }}
            />
            <Star
            h="2px"
            w="2px"
            animate={{ y: [-1090, 1090] }}
            transition={{ ease: "linear", duration: 10, repeat: Infinity }}
            />
